import React from 'react'

import { Row, Col } from 'react-bootstrap';
const Country = (props) => {
    return (
        <div>
            <Row>
                {
                    props.data.map((data) => {
                        console.log(data.name.common);
                        const { name, flags, capital, area, population } = data;
                        return (
                            <Col>
                                <h1>{name.common}</h1>

                            </Col>
                        );
                    })
                }
            </Row>

        </div>
    )
}

export default Country
